import { Link } from 'react-router-dom';

export default function Home() {
  return (
    <div className='home-container'>
       <nav
       className='home-navbar'>
           <Link to='#'>#VANLIFE</Link>
           <Link to='/about'>About</Link>
           <Link to='#'>Vans</Link>
       </nav>

       <main className='home-main'>
           <section className='home-section'>
               <h1 className='home-h1'>You got the travel plans, we got the travel vans</h1>
               <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Omnis fugiat iure molestiae !</p>
               <button className='home-button'>Find your van</button>
           </section>
       </main>

       <footer className='home-footer'>
               <small>&copy; 2022 #VANLIFE</small>
        </footer>
    </div>
  );
};
